import '../css/Home.css';
import React, { useEffect } from 'react';

function Home() {
    useEffect(() => {
        const textHome = "/users/MyronTruesdale: Home";
        let index = 0;
        const speed = 100; // Typing speed in milliseconds

        function typeWriter() {
            if (index < textHome.length) {
                let element = document.getElementById("typeHome");
                if(element) {
                    element.innerHTML += textHome.charAt(index);
                    index++;
                    setTimeout(typeWriter, speed);
                }
            }
        }

        typeWriter();
    }, []); // Empty array ensures this effect runs once after initial render

    return (
        <div>
            <div class="color-change">
                <div id="prompt">
                    <div id="bar">
                        <div class="circle" id="close"></div>
                        <div class="circle" id="minimize"></div>
                        <div id="maximize"></div>
                    </div>
                    <h1 id="typeHome"></h1>
                </div>
            </div>

            <div class="min-container"><p>Penis 2</p></div>

            <p>Penis</p>
        </div>
    );
}

export default Home;
